import React from 'react';
import PropTypes from 'prop-types';
import {
  PokemonCard,
  PokemonCardContent,
  PokemonCardFooter,
  PokemonCardMedia,
  PokemonCardBody,
  // ButtonInfo,
  Typographys,
} from './MaterialCardStyle';
import Grid from '@material-ui/core/Grid';

const MaterialCard = ({
    pokemons,
}) => (
  <div>
    {
     pokemons.map(pokemon => (
    <Grid item xs="3">
      <PokemonCard>
          <PokemonCardContent>
  
            <PokemonCardMedia />

            <PokemonCardBody>
              <Typographys gutterBottom variant="h5" component="h2">
                blabla
              </Typographys>
            </PokemonCardBody>
          </PokemonCardContent>
        <PokemonCardFooter />
      </PokemonCard>
    </Grid>
     )) 
    }

  </div>
);

MaterialCard.propTypes = {
  pokemons: PropTypes.array,
}

export default MaterialCard;
